+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="F02909CB4C1CC6D85C9C90ADAAD27F79", NativeString="If it does, if we lose... I am proud of what I have accomplished.", LocalizedStrings=(("ar"," وإن حدث ذلك، إن هُزِمنا... فأنا فخورة بما حققته."),("de","Falls es so weit kommt, falls wir verlieren•... bin ich wenigstens stolz auf das, was ich geleistet habe."),("es","Si es así, si perdemos... Me llena de orgullo lo que he conseguido."),("es-419","Si perdemos... Estoy orgullosa de lo que he logrado."),("fr","S'il y parvient, si nous perdons... Je serai fière de ce que j'ai accompli."),("id","Jika itu terjadi, jika kita kalah ... Aku tetap bangga dengan pencapaianku."),("it","Se succedesse davvero, se perdessimo... Sono fiera di ciò che ho realizzato."),("ja","奪われてしまったとしても、負けたとしても… 自分が成し遂げたことは誇りに思っているわ。"),("ko","그렇게 된다면, 우리가 지게 되더라도... 내가 이룬 일에 나는 자랑스러워하리라."),("pl","Jeśli tak się stanie, jeśli przegramy... Jestem dumna ze swoich osiągnięć."),("pt-BR","Se isso acontecer, se nós perdermos... Eu tenho orgulho do que conquistei."),("ru","Если мы всё-таки проиграем… Я считаю, что всё равно многого сумела добиться."),("th","ถ้ามันทำสำเร็จ และถ้าเราแพ้… ฉันก็ภูมิใจในสิ่งที่ฉันได้ทำเอาไว้"),("tr","Eğer giderse, kaybedersek... Başardıklarımızla gurur duyacağım."),("vi","Nếu điều đó xảy ra, nếu chúng ta thua... Ta tự hào về những gì mình đã làm được."),("zh-hans","如果我们失败，我又失去了自由……起码我会为我的付出感到骄傲。"),("zh-Hant","要是真的裂開，要是我們真的輸了……我對於自己的成就感到很驕傲。")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="DF6AAA7A6FFF3AD8DBF073F1BA4021B8", NativeString="It is funny. I earned my freedom, and now this conflict may rip it from my hands.", LocalizedStrings=(("ar","إنه لأمر مضحك. لقد حصلت على حريتي، والآن قد أفقدها بسبب هذا الصراع."),("de","Es ist schon komisch. Ich habe meine Freiheit erlangt und dieser Konflikt könnte sie mir wieder entreißen."),("es","Tiene gracia, me he ganado la libertad y, ahora, este conflicto podría arrebatármela de las manos."),("es-419","Qué divertido. Me gané mi libertad, y ahora este conflicto podría arrebatármela de las manos."),("fr","C'est amusant. J'ai gagné ma liberté, et ce conflit menace de me l'arracher à nouveau."),("id","Lucu sekali. Aku telah mendapatkan kebebasanku, dan kini konflik ini mungkin akan merebutnya dariku."),("it","È buffo. Mi sono guadagnata la libertà e ora rischio che mi venga strappata da questo conflitto."),("ja","おかしな話ね。自由を勝ち取ったのに、この争いでまた奪われるかもしれない。"),("ko","재미있군. 자유를 얻었으나, 이제 이 분쟁으로 인해 내 손에서 찢겨져 나갈지도 모른다니."),("pl","Zabawne. Zdobyłam swą wolność, a teraz ten konflikt może mi ją wyrwać z rąk."),("pt-BR","É engraçado. Eu conquistei minha liberdade, e agora esse conflito pode arrancá-la de mim."),("ru","Какая ирония. Только я обрела свободу, как новый конфликт снова грозит меня её лишить."),("th","ตลกดีนะ ฉันต่อสู้เพื่อให้ได้อิสรภาพมา และตอนนี้ความขัดแย้งนี้กำลังจะพรากมันไปจากมือฉัน"),("tr","Ne komik... Özgürlüğümü kazandım ama şimdi bu savaş yüzünden tekrar elimden kayıp gidebilir."),("vi","Thật hài hước làm sao. Ta đã giành lấy tự do cho mình, giờ thì cuộc xung đột này có thể tước nó khỏi tay ta."),("zh-hans","好笑。我好不容易获得的自由，又可能因为这场冲突而失去。"),("zh-Hant","真好笑。我好不容易才爭取到的自由，卻有可能會被這場戰火奪走。")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="C2D41D4C456C6965DBE067A7CBE90654", NativeString="We must act, and soon. And who knows? Perhaps we'll find ourselves with the unlikeliest upper hand.", LocalizedStrings=(("ar","يجب أن نتحرك وبسرعة. ومن يدري؟ ربما نحظى بأفضلية غير متوقَّعة."),("de","Wie müssen handeln – und zwar bald. Und wer weiß? Vielleicht gewinnen wir tatsächlich die Oberhand."),("es","Debemos actuar, y rápido. Y ¿quién sabe? Quizá tengamos ventaja, contra todo pronóstico."),("es-419","Debemos actuar... rápido. Y ¿quién sabe? Quizá nos encontremos con una ventaja poco probable."),("fr","Nous devons donc agir. Qui sait ? Le hasard nous aidera peut-être à prendre le dessus."),("id","Kita harus segera bertindak. Dan, siapa tahu? Kita bakal dapat keajaiban dan jadi lebih unggul dari mereka."),("it","Bisogna agire, e in fretta. E chi può dirlo? Forse ci ritroveremo in una posizione di vantaggio inaspettata."),("ja","すぐに行動しないと。やってみないとわからないでしょ？ もしかすると、思いがけず優位に立てるかもしれない。"),("ko","어서 행동에 나서야 해. 누가 알겠어? 전혀 예상하지 못한 우위를 얻게 될지."),("pl","Musimy działać, i to szybko. A kto wie? Może wbrew wszystkiemu zdobędziemy przewagę."),("pt-BR","A gente precisa agir, e rápido. Vai saber? Talvez a gente até acabe com a vantagem mais improvável."),("ru","Мы должны действовать — да побыстрее. И кто знает? Возможно, у нас появится неожиданное преимущество."),("th","เราต้องลงมือ และต้องเร็ว และใครจะรู้ล่ะ? บางทีเราอาจได้เปรียบในแบบที่คาดไม่ถึงสุด ๆ เลยก็ได้"),("tr","Harekete geçmeliyiz, bir an önce. Kim bilir? Belki ilginç bir şekilde avantaj bizde olur."),("vi","Chúng ta phải hành động, càng sớm càng tốt. Và ai mà biết được? Có khi chúng ta lại vô tính chiếm được lợi thế không ngờ nhất."),("zh-hans","我们不能再等，必须马上行动。谁又能预料接下来会发生什么？说不定，我们反而能占到上风。"),("zh-Hant","我們必須採取行動，而且要快。而且誰知道呢？說不定我們能意外地佔據上風。")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="66DE8D69454E8E5B39FD9B85DDC56171", NativeString="With the Swarm gone, our window of opportunity to initiate this conflict is closing rapidly.", LocalizedStrings=(("ar","مع رحيل السرب، أوشكت فرصتنا لإشعال هذا الصراع على الانتهاء."),("de","Jetzt, da der Schwarm weg ist, haben wir nur kurz die Gelegenheit, diesen Konflikt zu beginnen."),("es","Ahora que la plaga ha desaparecido, el tiempo que tenemos para iniciar el conflicto se va reduciendo."),("es-419","Ahora que no está el enjambre, nuestra ventana de oportunidad para iniciar el conflicto se cierra rápidamente."),("fr","L'occasion qui nous est offerte par la disparition de l'essaim risque de se refermer bien vite."),("id","Gerombolan sudah pergi, kesempatan kita memicu konflik ini juga makin sempit."),("it","Ora che lo Sciame non c'è più, la nostra possibilità di avviare questo conflitto si sta riducendo a vista d'occhio."),("ja","スウォームがいなくなったことで、戦いを仕掛けるチャンスは急速に閉ざされつつある。"),("ko","스웜은 사라졌고, 이 전투를 시작할 기회의 창이 빠르게 닫히고 있어."),("pl","Skoro Rój zniknął, szansa na zainicjowanie tego konfliktu zaczyna nam uciekać."),("pt-BR","Sem o Enxame, nossa chance de iniciar esse conflito tá acabando rapidamente."),("ru","Теперь, когда роя больше нет, наш шанс начать этот конфликт стремительно ускользает."),("th","เมื่อฝูงแมลงหายไป โอกาสของเราที่จะชิงลงมือก่อนก็กำลังจะหมดลงอย่างรวดเร็วเช่นกัน"),("tr","Sürü gitmişken bu savaşı başlatma fırsatına sahip olduğumuz süre hızla daralıyor."),("vi","Giờ Bầy Bọ đã biến mất,  chúng ta sắp chẳng còn cơ hội phát động xung đột này."),("zh-hans","虫群消失后，我们主动开战的时机正在飞速流逝。"),("zh-Hant","隨著蟲群的消失，我們發動突襲的時機也在迅速消逝。")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="40524BD24FD4509A980332AC51F93867", NativeString="But I must admit, begrudgingly... Hope and Jones are right.", LocalizedStrings=(("ar","لكنني أعترف، على مضض.. بأن أمل وجونز محقان."),("de","Ich muss jedoch widerwillig zugeben ... dass Hope und Jones recht haben."),("es","Pero debo admitir a regañadientes... que Hope y Jones están en lo cierto."),("es-419","Pero debo admitir a regañadientes que... Hope y Jones tienen razón."),("fr","Cela étant, je suis bien obligée d'admettre que Hope et Jones ont raison."),("id","Tapi harus aku akui, sayangnya ... Hope dan Jones benar."),("it","Tuttavia. devo ammettere a malincuore che... Hope e Jones hanno ragione."),("ja","でも認めざるを得ないわ。不本意だけど… ホープとジョーンズは正しい。"),("ko","내키진 않지만 인정해야겠지... 호프와 존스가 맞았어."),("pl","Muszę jednak niechętnie przyznać... że Nadzieja i Jones mają rację."),("pt-BR","Mas, infelizmente, tenho que admitir que... a Valentia e o Jones têm razão."),("ru","Неприятно это признавать, но… Хоуп и Джоунс правы."),("th","แต่คงต้องยอมรับแบบไม่เต็มใจนัก… โฮปกับโจนส์พูดถูกจริง ๆ"),("tr","Ama istemeyerek de olsa itiraf etmeliyim ki... Umut ve Jonesy haklı."),("vi","Nhưng ta phải thừa nhận, dù không cam tâm... rằng Hope và Jones đã đúng."),("zh-hans","虽然我不太愿意承认……但霍普和琼斯说得没错。"),("zh-Hant","雖然很不情願，但我必須承認……霍普和瓊斯是對的。")))
+TextReplacements=(Category=Game, Namespace="", Key="1068AB61485AE16DBE6C6799805ABE3D", NativeString="Open your Mail", LocalizedStrings=(("ar","تحقق من بريدك للحصول على هدية خاصة!"),("en","Check your mail for a special gift!"),("de","Wirf einen Blick in dein Postfach, um ein besonderes Geschenk zu erhalten!"),("es","¡Comprueba tu buzón para conseguir un regalo especial!"),("es-419","¡Abre el buzón para obtener un regalo especial!"),("fr","Ouvrir votre courrier pour recevoir un cadeau"),("id","Cek email kamu untuk hadiah spesial!"),("it","Controlla la posta per un regalo speciale!"),("ja","特別な贈り物が届いているか郵便を確認しよう！"),("ko","우편함을 열어 특별한 선물을 확인해 보세요!"),("pl","Sprawdź skrzynkę pocztową, by otrzymać specjalny prezent!"),("pt-BR","Verifique sua caixa de correio para achar um presente especial!"),("ru","Проверьте почтовый ящик — там ждёт особый подарок!"),("th","เช็กอีเมลของคุณดูสิ มีของขวัญพิเศษรออยู่!"),("tr","Özel bir hediye için posta kutunu kontrol et!"),("vi","Kiểm tra hộp thư để nhận phần quà đặc biệt!"),("zh-hans","快去查收你的特别礼物！"),("zh-Hant","快查看信箱，有特別禮物等著你！")))
+TextReplacements=(Category=Game, Namespace="", Key="8B062A0B4396FA343893CC91F4BB38C8", NativeString="You've received your Daily Cred Drop! Head to an ATM to get your Creds!", LocalizedStrings=(("ar","أصبحت <emphasis>إمدادك اليومي من الأرصدة</> متاحة الآن! (لكن قد يواجه السكان الذين استخدموا جرعات <emphasis>التحول إلى حيوانات</> صعوبة في استخدام جهاز الصراف الآلي، بسبب... الحوافر.)"),("en","Your <emphasis>Daily Cred Drop</> is available now! (But residents who have used <emphasis>Potions to transform into animals</> might have trouble using the <emphasis>ATM</> though, because… thumbs.)"),("de","Deine <emphasis>täglichen Credits</> sind jetzt verfügbar! (Bewohner, die <emphasis>Tränke für die Verwandlung in Tiere</> verwendet haben, könnten sich allerdings wegen fehlender Daumen mit der Benutzung von <emphasis>Geldautomaten</> schwertun.)"),("es","¡Ya tienes disponible tu <emphasis>entrega diaria de guita</>! Puede que los residentes que hayan usado <emphasis>pociones para transformarse en animales</> tengan problemillas a la hora de ir al <emphasis>cajero automático</> porque... bueno, no tienen pulgares oponibles."),("es-419","¡La <emphasis>entrega de créditos diaria</> ya está disponible! (Pero los residentes que hayan usado <emphasis>pociones para convertirse en animales</> puede que tengan problemas al usar el <emphasis>cajero</> por la falta de pulgares)."),("fr","Vous avez reçu la bourse de la ville ! (Mais les résidents qui ont utilisé une <emphasis>potion pour se transformer en animal</> vont avoir du mal à utiliser le <emphasis>distributeur</> par manque de... pouces fonctionnels.)"),("id","<emphasis>Drop Cred Harian</> milikmu telah tersedia! (Namun, para warga yang telah <emphasis>berubah menjadi hewan akibat meminum Ramuan</> mungkin akan kesulitan memakai <emphasis>ATM</> sebab tak punya ... ibu jari."),("it","Il tuo <emphasis>Accredito giornaliero</> è ora disponibile! (Ma gli abitanti che hanno utilizzato <emphasis>pozioni per trasformarsi in animali</> potrebbero avere qualche problema con il <emphasis>bancomat</> non avendo… le mani.)"),("ja","キミの<emphasis>デイリークレジット</>は、いま受け取れるぞ！ (<emphasis>動物に変身するポーション</>を使った住人は、<emphasis>ATM</>を使うのが難しいかもしれない。なぜって、それは指が無いから...)"),("ko","<emphasis>일일 크레딧 보상</>을 받으세요! (단, <emphasis>강아지 변신 물약</>을 사용한 주민은 <emphasis>ATM</> 이용에 불편을 겪을 수도 있습니다. 이유는... 엄지손가락이 없기 때문이죠.)"),("pl","Twoja <emphasis>codzienna porcja k-siorki</> jest już gotowa! (Mieszkańcy, którzy użyli <emphasis>mikstur, by przeobrazić się w zwierzęta</> mogą mieć problem z bankomatem przez... brak kciuków)."),("pt-BR","Sua <emphasis>Entrega de Dindim Diária</> está disponível! (Mas residentes que usaram <emphasis>Poções para se transformar em animais</> podem ter dificuldade com o <emphasis>Caixa Eletrônico</> sem seus... dedos.)"),("ru","Получены <emphasis>ежедневные кредиты</>! (Однако жители, использовавшие <emphasis>зелья для превращения в животных</>, могут испытывать трудности с использованием <emphasis>банкомата</>, потому что... лапки)."),("th","<emphasis>เงินประจำวัน</>ของคุณพร้อมแล้ว! (แต่ผู้อยู่อาศัยที่ใช้<emphasis>น้ำยาแปลงร่างเป็นสัตว์</>อาจใช้<emphasis>ตู้ ATM</>ลำบากหน่อยนะ เพราะ... ไม่มีนิ้วโป้ง)"),("tr","<emphasis>Günlük Kredi Desteği</> hazır! (Aman dikkat, bir hayvana dönüşme <emphasis>İksiri</> kullanan sakinler <emphasis>bankamatiği</> kullanırken zorlanabilirler. Bu soruna henüz parmak basamadılar..."),("vi","Bạn đã được tặng <emphasis>Xu Tặng Hằng Ngày</> rồi! (Nhưng cư dân nào sử dụng <emphasis>Nước Thần để hóa thú</> có thể gặp rắc rối khi sử dụng <emphasis>ATM</> vì… ngón cái.)"),("zh-hans","你的 <emphasis>每日积金掉落</> 已到账！不过……那些喝了药水变成动物的居民，可能在用 <emphasis>ATM</> 时会遇到点小麻烦，毕竟，他们没有拇指。"),("zh-Hant","你的<emphasis>每日聲望幣獎勵</>已到帳！（不過，喝了<emphasis>動物變身藥水</>變成動物的居民……可能在操作<emphasis>ATM</>時會有點難度，畢竟……沒有拇指嘛。）")))
+TextReplacements=(Category=Game, Namespace="", Key="E12A9E6847DB202B2F319EA6D75A1839", NativeString="Free Doggify Potion Ingredient!", LocalizedStrings=(("ar","مكونات جرعة التحول إلى كلب المجانية!"),("en","Free Doggify Potion Ingredient!"),("de","Kostenlose Zutat für den Hundifizierungstrank!"),("es","¡Ingrediente gratis para la poción perrinizadora!"),("es-419","¡Ingrediente gratis para la poción perrificadora!"),("fr","Ingrédient gratuit pour la potion de chien !"),("id","Bahan Ramuan Anjingisasi Gratis"),("it","Ingrediente gratuito per la pozione canide!"),("ja","無料のイヌ化ポーションの材料だ！"),("ko","무료 강아지 변신 물약!"),("pl","Darmowy składnik mikstury piesizacji!"),("pt-BR","Ingrediente grátis da Poção Canificadora!"),("ru","Бесплатный ингредиент для зелья собакофикации!"),("th","วัตถุดิบน้ำยาพลังโฮ่งฟรี!"),("tr","Ücretsiz Köpekleştirme İksiri Malzemesi!"),("vi","Nguyên Liệu Nước Thần Hóa Chó Mới!"),("zh-hans","免费领取狗狗转化药水材料！"),("zh-Hant","免費「狗化藥水」材料！")))
+TextReplacements=(Category=Game, Namespace="", Key="274FC8DD48075B9D28A83AA1FFEFAF6C", NativeString="Free Potions Cauldron!", LocalizedStrings=(("ar","مرجل الجرعات المجانية!"),("en","Free Potions Cauldron!"),("de","Kostenloser Trankkessel!"),("es","¡Caldero de pociones gratis!"),("es-419","¡Caldero de pociones gratis!"),("fr","Chaudron à potions gratuit !"),("id","Ketel Ramuan Gratis"),("it","Calderone per pozioni gratuito!"),("ja","無料のポーションの大釜だ！"),("ko","무료 물약 솥!"),("pl","Darmowy kocioł mikstur!"),("pt-BR","Caldeirão de Poções grátis!"),("ru","Бесплатный котёл для зельеварения!"),("th","หม้อปรุงยาฟรี!"),("tr","Ücretsiz İksir Kazanı!"),("vi","Vạc Nước Thần Miễn Phí!"),("zh-hans","免费领取药水坩埚！"),("zh-Hant","免費藥水大釜！")))
+TextReplacements=(Category=Game, Namespace="", Key="10443051438E124BD742A9B87BEB2D7C", NativeString="Brew this <emphasis>Balloon Dog</> with a drink so fine… to create a <emphasis>Potion</> to be a canine!", LocalizedStrings=(("ar","قم بتحضير <emphasis>كلب البالون</> مع مشروب لذيذ... لإنشاء <emphasis>جرعة</> التحول!"),("en","Brew this <emphasis>Balloon Dog</> with a drink so fine… to create a <emphasis>Potion</> to be a canine!"),("de","Kombiniere diesen <emphasis>Ballonhund</> mit einem Getränk – und wau! Schon bekommst du einen pfotenstarken <emphasis>Trank</> geschenkt!"),("es","Si una <emphasis>poción</> canina quieres crear, ¡un <emphasis>perrito de globo</> con una bebida te toca mezclar!"),("es-419","Si una <emphasis>poción</> canina quieres crear, ¡una bebida y este <emphasis>perro de globo</> tendrás que mezclar!"),("fr","Mélangez cet <emphasis>animal en ballon</> avec une boisson... pour devenir un superbe chien en buvant cette <emphasis>potion</> !"),("id","Seduh <emphasis>Balon Hewan</> ini dengan minuman paling enak untuk memunculkan anjing menggunakan <emphasis>Ramuan</>!"),("it","Prepara questo <emphasis>animale palloncino</> con una bevanda così raffinata… da creare una <emphasis>pozione</> per diventare un canide!"),("ja","この<emphasis>アニマルバルーン</>と飲み物を醸造して… イヌになる<emphasis>ポーション</>を作ろう！"),("ko","이 멋진 음료와 <emphasis>동물 풍선</>을 섞으면 강아지로 변신하는 <emphasis>물약</>이 완성됩니다!"),("pl","Szczypta <emphasis>balonowego psa</>, napoju łyk... i już masz <emphasis>miksturę</>, by pieskiem stać się w mig!"),("pt-BR","Misture esse <emphasis>Balão Animal</> com uma bebida que decidir... para criar uma <emphasis>Poção</> que te faz latir!"),("ru","<emphasis>Шарик собаки</> с напитком смешай... Как <emphasis>зелье</> получишь — так сразу же лай! "),("th","ผสม<emphasis>สุนัขลูกโป่ง</>กับเครื่องดื่มแสนอร่อย... เพื่อรังสรรค์<emphasis>น้ำยา</>แปลงร่างเป็นสุนัข!"),("tr","Bu <emphasis>Balon Hayvan</>'ı müthiş bir içecekle birleştir... Bu sayede köpek vücuduna geçmeni sağlayan bir <emphasis>İksir</> hazırlamış olacaksın!"),("vi","Pha <emphasis>Bóng Bay Chó</> với nước uống cực ngon… để tạo nên <emphasis>Nước Thần</> hóa chó!"),("zh-hans","用这只 <emphasis>气球狗</> 搭配一杯精致饮品……酿出让你变成 <emphasis>斗牛犬</> 的魔法药水吧！"),("zh-Hant","用這個<emphasis>氣球狗狗</>加上一杯極好的飲品，調製出一瓶<emphasis>藥水</>化身犬類！")))
+TextReplacements=(Category=Game, Namespace="", Key="59CC817D40311DC758C723960BE530D2", NativeString="Here’s a <emphasis>drink</> for special use… it’s one half of the <emphasis>Doggify</> juice!", LocalizedStrings=(("ar","إليك <emphasis>مشروبًا</> للاستخدام الخاص... إنه نصف عصير تحول <emphasis>الكلب</>!"),("en","Here’s a <emphasis>drink</> for special use… it’s one half of the <emphasis>Doggify</> juice!"),("de","Dieses <emphasis>Getränk</> verleiht tierische Kraft … der <emphasis>Hundifizierungstrank</> ist halb geschafft!"),("es","¡Esta <emphasis>bebida</> es tan solo la mitad de una <emphasis>poción perrinizadora</> de verdad!"),("es-419","Aquí tienes una <emphasis>bebida</> para importantes horas... ¡una mitad de la poción <emphasis>perrificadora</>!"),("fr","Et voici une <emphasis>boisson</> qui vous fera du bien... c'est l'une des deux moitiés de la <emphasis>potion de chien</> !"),("id","Ambil <emphasis>minuman</> ini untuk pemakaian khusus ... yang  setengahnya merupakan bagian dari jus <emphasis>Anjingisasi</>!"),("it","Ecco qui una <emphasis>bevanda</> per un uso speciale… Una metà dell'intruglio <emphasis>canide</>!"),("ja","これは特別な用途に使える<emphasis>飲み物</>… <emphasis>イヌ化ポーション</>の半分の効力を持つジュースだ！"),("ko","이 특별한 <emphasis>음료</>로 <emphasis>강아지 변신 물약</>을 완성하세요!"),("pl","Napij się odrobiny tego <emphasis>specjału</>, by osiągnąć formę <emphasis>psiego</> ideału!"),("pt-BR","Aqui está uma <emphasis>bebida</> promissora... É metade da <emphasis>Poção Canificadora</>!"),("ru","<emphasis>Напиток</> этот непростой формации... Он — половина зелья для <emphasis>собакофикации</>!"),("th","นี่คือ<emphasis>น้ำยา</>ที่ใช้ในโอกาสพิเศษ... มันคือน้ำยา<emphasis>พลังโฮ่ง</>ที่เหลืออยู่ครึ่งหนึ่ง!"),("tr","İşte sana özel bir amaç için kullanabileceğin bir <emphasis>İçecek</>... <emphasis>Köpekleştirme</> işi için gerekenlerin yarısı bu!"),("vi","Đây là <emphasis>nước uống</> dành cho dịp đặc biệt… nó chỉ là một nửa <emphasis>Nước Thần Hóa Chó</>!"),("zh-hans","这杯 <emphasis>饮品</> 可不一般……它是 <emphasis>狗狗转化</> 药水的一半成分！"),("zh-Hant","這是特調的<emphasis>飲品</>……它是<emphasis>狗化配方</>的一半成分！")))
+TextReplacements=(Category=Game, Namespace="", Key="7489B68B483E7CC46296A3BCCF21A258", NativeString="A <emphasis>Potion</> to brew, a <emphasis>Cauldron</> to place…. Use these items to change your face! Combine any <emphasis>Drink</> with <emphasis>a Balloon Dog</> in the <emphasis>Cauldron</> to brew a <emphasis>Doggify Potion</>!", LocalizedStrings=(("ar","<emphasis>مرجّل</> للاستخدام، <emphasis>وجرعة</> للتحضير... استخدم هذه العناصر لتغيير مظهرك! امزج أي <emphasis>مشروب</> مع <emphasis>بالون كلب</> في <emphasis>المرجّل</> لتخمير جرعة <emphasis>التحول لكلب</>!"),("en","A <emphasis>Potion</> to brew, a <emphasis>Cauldron</> to place…. Use these items to change your face! Combine any <emphasis>Drink</> with <emphasis>a Balloon Dog</> in the <emphasis>Cauldron</> to brew a <emphasis>Doggify Potion</>!"),("de","Braue den <emphasis>Trank</> und platziere den <emphasis>Kessel</> … mit diesen Gegenständen wird dein neues Ich entfesselt! Verwende ein beliebiges <emphasis>Getränk</> mit <einem Ballonhund</> im <emphasis>Kessel</>, um einen <emphasis>Hundifizierungstrank</> herzustellen!"),("es","Un <emphasis>caldero</> colocarás y una <emphasis>poción</> prepararás. Así, ¡tu apariencia cambiarás! Combina cualquier <emphasis>bebida</> con un <emphasis>perrito de globo</> en el <emphasis>caldero</> para preparar una <emphasis>poción perrinizadora</>."),("es-419","Con un <emphasis>caldero</> y una <emphasis>poción</>, ¡no faltará la diversión! ¡Mezcla cualquier <emphasis>bebida</> con <emphasis>un perro de globo</> en el <emphasis>caldero</> para preparar una <emphasis>poción perrificadora</>!"),("fr","Une <emphasis>potion</> à mélanger et un <emphasis>chaudron</> à placer... Vous rêviez de changer de visage ? Ajoutez n'importe quelle <emphasis>boisson</> ainsi qu'un <emphasis>animal en ballon</> dans votre <emphasis>chaudron</> pour concevoir une <emphasis>potion de chien</> !"),("id","Ada sebuah <emphasis>Ramuan</> yang perlu diseduh, juga sebuah <emphasis>Ketel</> yang perlu disiapkan .... Gunakan item ini untuk mengubah wajahmu! Kombinasikan <emphasis>Minuman</> apa pun dengan <emphasis>Balon Hewan</> di dalam <emphasis>Ketel</> untuk menyeduh <emphasis>Ramuan Anjingisasi</>"),("it","Una <emphasis>pozione</> da preparare, un <emphasis>calderone</> da posizionare. Usa questi oggetti per cambiare volto! Combina una <emphasis>bevanda</> qualsiasi con un <emphasis>animale palloncino</> nel <emphasis>calderone</> per preparare una <emphasis>pozione canide</>!"),("ja","<emphasis>ポーション</>の材料、ポーションを作るのに使う<emphasis>大釜</>… これらのアイテムを使って自分の見た目を変えよう！ <emphasis>飲み物どれでも</>と<emphasis>アニマルバルーン</>を<emphasis>大釜</>の中で混ぜて、<emphasis>イヌ化ポーション</>を醸造しよう！"),("ko","<emphasis>물약</>을 <emphasis>솥</>에 넣고 섞으세요. 이 아이템들로 변신을 시도하세요! 아무 <emphasis>음료</>를 <emphasis>동물 풍선</>과 함께  <emphasis>솥</>에 넣고 섞으면 <emphasis>강아지 변신 물약</>이 완성됩니다!"),("pl","<emphasis>Kociołek</> w ruch, <emphasis>mikstury</> buch, zaraz poczujesz psiego oddechu chuch! Połącz dowolny <emphasis>napój</> z <emphasis>balonowym psem</> w <emphasis>kotle</>, by uwarzyć <emphasis>miksturę piesizacji</>!"),("pt-BR","Uma <emphasis>Poção</> na mão, um <emphasis>Caldeirão</> no chão... use estes itens para uma transformação! Misture qualquer <emphasis>Bebida</> com um <emphasis>Balão Animal</> no <emphasis>Caldeirão de Poções</> para criar uma <emphasis>Poção Canificadora</>!"),("ru","<emphasis>Котёл</> размести — да <emphasis>зелье</> свари... Новым лицом весь мир озари! Смешай любой <emphasis>напиток</> с <emphasis>шариком в виде собаки</> в <emphasis>котле</>, чтобы сварить <emphasis>зелье собакофикации</>!"),("th","<emphasis>น้ำยา</>ที่ต้องต้ม <emphasis>หม้อปรุง</>ที่ต้องวาง... ใช้ของเหล่านี้เพื่อเปลี่ยนรูปลักษณ์ของคุณ! ผสม<emphasis>เครื่องดื่ม</>ใดก็ได้กับ<emphasis>สุนัขลูกโป่ง</> ใน<emphasis>หม้อปรุง</> เพื่อปรุง<emphasis>น้ำยาพลังโฮ่ง</>!"),("tr","Hazırlanacak bir <emphasis>İksir</> varsa... önce bir <emphasis>Kazan</> ayarla. Bu malzemeleri bir araya getirerek kılık değiştir! Herhangi bir  <emphasis>İçecek</> ve <emphasis>Balon Hayvan</>'ı <emphasis>Kazan</>'da birleştirerek bir <emphasis>Köpekleştirme İksiri</> hazırla! "),("vi","Pha một lọ <emphasis>Nước Thần</>, đặt xuống một cái <emphasis>Vạc</>... Sử dụng những vật phẩm này để thay đổi khuôn mặt của bạn! Kết hợp bất kỳ <emphasis>Đồ Uống</> nào với <emphasis>Bóng Bay Chó</> trong <emphasis>Vạc</> để pha chế <emphasis>Nước Thần Hóa Chó</>!"),("zh-hans","有 <emphasis>药水</> 可调，有 <emphasis>坩埚</> 可放……这次用魔法换张脸！把任意 <emphasis>饮品</> 和 <emphasis>气球狗</> 一起放进 <emphasis>坩埚</> 中，就能调出 <emphasis>狗狗转化药水</>！"),("zh-Hant","欲調製<emphasis>藥水</>，先備好<emphasis>大釜</>……變臉就靠這些道具！在<emphasis>大釜</>中將任意<emphasis>飲品</>與<emphasis>氣球狗狗</>混合，即可調出<emphasis>狗化藥水</>！")))
