+TextReplacements=(Category=Game, Namespace="", Key="5EB6C1034C66CDBA48642A9EA899558E", NativeString="The first headshot damage will hit the Jebidiah head. Once it  flies off, it will be available to pickup again", LocalizedStrings=(("ar","ستصيب أول طلقة رأس جيبيدايا. بمجرد سقوطه، سيصبح متاحًا للالتقاط مرة أخرى"),("en","The first headshot damage will hit the Jebediah head. Once it flies off, it will be available to pick up again"),("de","Der erste Kopfschussschaden wird den Jebediah-Kopf treffen. Sobald er wegfliegt, kann er wieder aufgehoben werden"),("es","La primera vez que se inflija daño a la cabeza alcanzará la cabeza de Jebediah. Cuando salga volando, estará disponible para recogerse de nuevo."),("es-419","El primer disparo a la cabeza impactará en la cabeza de Jeremías Springfield. Cuando salga volando, estará disponible para volver a recogerse."),("fr","Les premiers dégâts à la tête touchent la tête de Jebediah. Une fois qu'elle s'est envolée, elle peut être ramassée à nouveau."),("id","Damage tembakan kepala pertama akan mengenai kepala Jebediah. Setelah terbang, ini akan kembali tersedia untuk diambil"),("it","Il primo danno da colpo alla testa colpirà la testa di Jebediah. Una volta fatta saltare, potrà essere raccolta"),("ja","最初のヘッドショットダメージはジェバダイアの頭が肩代わりする。 飛んでいった頭は再度拾うことが可能。"),("ko","첫 헤드샷 피해는 제버다이어의 머리를 맞힙니다. 날아간 후에는 다시 주울 수 있습니다."),("pl","Pierwsze trafienie w głowę uszkodzi głowę Jebediaha. Kiedy odleci, można jeszcze raz podnieść"),("pt-BR","O primeiro dano de acerto na cabeça atingirá a cabeça de Jebediah. Depois que ela sair voando, poderá ser coletada novamente"),("ru","Первое попадание в голову достанется Джебедае. Когда эффект закончится, предмет можно будет подобрать снова."),("th","ความเสียหายเฮดช็อตครั้งแรกจะโดนหัวเจบีไดอาห์ เมื่อมันหลุดออกมาแล้ว สามารถเก็บได้อีกครั้ง"),("tr","İlk kafadan vuruş hasarı Jebediah'ı kafasından vuracak. Uçtuğunda yeniden alınabilir."),("vi","Sát thương bắn trúng đầu đầu tiên sẽ bắn trúng đầu của Jebediah. Khi cái đầu rơi ra, bạn có thể nhặt lại nó được ngay"),("zh-hans","第一击爆头伤害将命中杰贝迪亚的头。 一旦射出之后，可以再次拾取"),("zh-Hant","首次爆頭傷害會命中傑布帶伊的頭。如果頭飛走，可以再撿起來")))
