+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="73C18C2242FFD86152B64297F82748D6", NativeString="NICE! The Neighborhood Initiation Congeniality Ensemble formally welcomes <emphasis>The Simpsons</> to Brick Bay! Springfield’s favorite family have taken up temporary residence in town, and residents are encouraged to give them a neighborly welcome. Start with <emphasis>a visit to Homer</>, who was last seen hungry and panicked at the <emphasis>Burger Battlegrounds</>!In extremely related news, we’re excited to announce the <emphasis>Burger Battlegrounds</>! <emphasis>Durrr Burger</> is going patty-to-patty with newcomer <emphasis>Krusty Burger</> in a festival of feats and feasting, and our hungry residents will decide the victor. Get your stomachs ready, strap on your voting-pants, and head down to the city center to cast a juicy, chargrilled ballot!", LocalizedStrings=(("id","BAGUS! Ansambel Keramahan Inisiasi Lingkungan dengan bangga menyambut <emphasis>The Simpsons</> di Brick Bay! Keluarga favorit dari Springfield kini menetap sementara di kota ini, dan warga dihimbau untuk memberi sambutan sehangat tetangga sejati! Mulailah dengan <emphasis>menengok Homer</>, yang terakhir terlihat lapar dan panik di <emphasis>Medan Perang Burger</>!Dalam berita yang sangat berkaitan, kami juga dengan senang hati mengumumkan hadirnya <emphasis>Medan Perang Burger</>! <emphasis>Durrr Burger</> berhadapan patty demi patty dengan pendatang baru <emphasis>Krusty Burger</> dalam festival aksi dan pesta makan, dan para warga yang kelaparan akan menentukan siapa pemenangnya. Siapkan perutmu, siapkan suara votingmu, dan turunlah ke pusat kota untuk memberikan suara yang segar dan matang-sempurna!")))
